import React from "react";

function Warning() {
  return (
    <div className="container">
      <p className="warning">
        It seems we haven't found product results that match your search query.
        :( <br />
        <br />
        To view the eco-friendly index of the sunscreen, please click here to
        upload the ingredient list. :)
      </p>
    </div>
  );
}

export default Warning;
